export function countries() {
  return format(parse(DATA))

  function parse(str) {
    const arr = []
    let quote = false
    for (let row = 0, col = 0, c = 0; c < str.length; c++) {
      let cc = str[c],
        nc = str[c + 1]
      arr[row] = arr[row] || []
      arr[row][col] = arr[row][col] || ''
      if (cc == '"' && quote && nc == '"') {
        arr[row][col] += cc
        ++c
        continue
      }
      if (cc == '"') {
        quote = !quote
        continue
      }
      if (cc == ',' && !quote) {
        ++col
        continue
      }
      if (cc == '\r' && nc == '\n' && !quote) {
        ++row
        col = 0
        ++c
        continue
      }
      if (cc == '\n' && !quote) {
        ++row
        col = 0
        continue
      }
      if (cc == '\r' && !quote) {
        ++row
        col = 0
        continue
      }
      arr[row][col] += cc
    }
    return arr
  }

  function format(data) {
    let countries = []
    data.forEach(function (item) {
      let find = countries.find((country) => country.name === item[1])
      if (find) {
        find.years.unshift(formatYear(item))
      } else {
        countries.push({ name: item[1], region: item[0], years: [] })
      }
    })
    return countries
  }

  function formatYear(item) {
    return {
      year: item[item[2]],
      representation: {
        score: item[3],
        rank: item[4],
        change_1y: item[5],
        change_5y: item[6]
      },
      rights: {
        score: item[7],
        rank: item[8],
        change_1y: item[9],
        change_5y: item[10]
      },
      law: {
        score: item[11],
        rank: item[12],
        change_1y: item[13],
        change_5y: item[14]
      },
      participation: {
        score: item[15],
        rank: item[16],
        change_1y: item[17],
        change_5y: item[18]
      }
    }
  }
}

